// Description: This module is used to decide which colour to show on the pixel. It will get the
//              pixel coordinate from VGA_Interface module and do some logic calculate to get the 
//              4096 colour(12-bit) for the pixel. There are four patterns to show on the monitor.
//              The first one is the basic funtion. The second one is my Chinese family name character.
//              The third one is four moving squres on the screen, and the number of aquares can be 
//              controlled by slide switches. The fourth one is display a image on the screen by 
//              internal ROM in the FPGA>
