module SomeLogic(
    input  [9:0] ADDRH,           //Horizontal coordinate for the pixel
    input  [8:0] ADDRV,           //Vertical coordinate for the pixel
    input  CLK,                   //Driven clock
    input  [1:0] NUMBER,          //Number of squares on the screen
    input  [1:0] PATTERN,         //Deicde which pattern to show
    input  [11:0] COLOUR_IN,      //Colour input from slide switchrs
    output reg [11:0] COLOUR_OUT //Colour ouput to VGA_Interface
    );
    
    wire SCLK;                  //100Hz clock to drizen the colour clock and square moving clock
    wire [11:0] COLOUR_FLOW;    //100Hz Flowing Colour
    wire [9:0] LOCATX0;         //X coordinate for the first square
    wire [8:0] LOCATY0;         //Y coordinate for the first square
    wire [9:0] LOCATX1;         //X coordinate for the second square
    wire [8:0] LOCATY1;         //Y coordinate for the second square
    wire [9:0] LOCATX2;         //X coordinate for the third square
    wire [8:0] LOCATY2;         //Y coordinate for the third square
    wire [9:0] LOCATX3;         //X coordinate for the fourth square
    wire [8:0] LOCATY3;         //Y coordinate for the fourth square
    reg [18:0] ADDRESS;         //Address in the ROM to get colour for the picture in pattern 4
    wire [11:0] PICCOLOUR;      //Colour get from the ROM
    reg CONDITION;              //Decide how many squares to show on the screen.
             
   //All the counters are wrapper in this module including the slow clock, colour flow clock,
   //and 8 coordinate clock for squares
   COUNTERS counters(
        .CLK(CLK),
        .sCLK(SCLK),
        .COLOUR_FLOW(COLOUR_FLOW),
        .NUMBER(NUMBER),
        .LOCATX0(LOCATX0),
        .LOCATY0(LOCATY0),
        .LOCATX1(LOCATX1),
        .LOCATY1(LOCATY1),
        .LOCATX2(LOCATX2),
        .LOCATY2(LOCATY2),
        .LOCATX3(LOCATX3),
        .LOCATY3(LOCATY3)
        );
// Instantiation of the ROM, input the address for the pixel and get the colour for that pixel in 
// return in pattern 4.                  
    blk_mem_gen_0 pic(
        .clka(CLK),
        .addra(ADDRESS),
        .douta(PICCOLOUR)
    );

//In this block is to show the four patterns on the screen                       
    always@(posedge CLK)
    begin
    case (PATTERN)              //choose the pattern
    
    //The first pattern is the basic function. There are four corner squares. The colour for the square
    //are inverse of the input from slide switches and the colour for rest of the screen is the input
    //slide switches. By changing the slide switches, the colour on the screen will change.
        2'b00:begin             
            if(( ADDRH >= 10'd0 && ADDRH < 10'd10 && ADDRV >= 9'd0 && ADDRV < 9'd10 )    //Range for the left top square
             ||( ADDRH > 10'd629 && ADDRH < 10'd640 && ADDRV >= 9'd0 && ADDRV < 9'd10 )  //Range for the right top square
             ||( ADDRH >= 10'd0 && ADDRH < 10'd10 && ADDRV > 9'd469 && ADDRV < 9'd480 )  //Range for the left bottom square
             ||( ADDRH > 10'd629 && ADDRH< 10'd640 && ADDRV > 9'd469 && ADDRV < 9'd480)  //Range for hte right bottom square
              )
                COLOUR_OUT <= ~COLOUR_IN;   //Colour for the four corner squares are the inverse of the input colour from slide switches
            else
                COLOUR_OUT <= COLOUR_IN;    //Colour for the rest part of the screen is the input colour of silde switches
        end
        
