//------------------------------------------------------------------------------------------------------
//This function shows a picture on monitor. Limited by capcity of the ROM, it can only shows a 
//320X240 picture. First I transfer the picture into a 4096 color photo, and them create a
//IP ROM, them store the color of each pixel into the ROM.        
        
        2'b11:begin
            //Define the 320 X 240 range
            if( ADDRH >=0 && ADDRH < 320 && ADDRV >=0 && ADDRV < 240) begin
                ADDRESS <= ( ADDRH + 320*ADDRV); //Calculate the address for pixel in ROM
                COLOUR_OUT <= PICCOLOUR;         //Get the colour for that puxel store in the ROM
            end else
                 COLOUR_OUT <= 12'b000000000000; //Other part of screen defines as black.
              
        end
